        {
            if (reader.ReadUtf16IsNull())
            {
                return null;
            }
            reader.ReadUtf16BeginArrayOrThrow();
            var list = new List<Uri>();
            var count = 0;
            while (!reader.TryReadUtf16IsEndArrayOrValueSeparator(ref count))
            {
                list.Add(ElementFormatter.Deserialize(ref reader));
            }

            return list;
        }
